import React, { useState } from 'react';

const Dropdown = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleDropdown = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div className="dropdown">
      <button onClick={toggleDropdown}>Cadastro</button>

      {isOpen && (
        <div className="dropdown-content">
          <p>Usuário</p>
          <p>Classes</p>
          <p>Composição</p>
          <p>Categoria</p>
          <p>Marca Elástico</p>
          <p></p>
          <p></p>
          <p></p>
          <p></p>
          <p></p>
          <p></p>
          <p></p>
          <p></p>
          <p></p>
          <p></p>
        </div>
      )}
    </div>
  );
};

export default Dropdown;
